import React, { useState } from 'react';

import FormControl from '@material-ui/core/FormControl';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';

function EnterLink() {
	const [radioValue, setRadioValue] = useState('Video')

	return (
		<div>
			<FormControl>
				<TextField error requiredlabel="" helperText="Can't be empty" />


				<FormControlLabel value="Video" control={<input type="radio" onChange={(event) => setRadioValue(event.target.value)} />} label="Video" />
				<FormControlLabel value="Playlist" control={<Radio color="primary" />} label="Playlist" />

				<Button
					color="primary"
					variant="outlined">Submit
				</Button>
			</FormControl>

		</div>
	);
}

export default EnterLink;
